import React from 'react';

class Travel extends React.Component {
    render() {
        return (

            <div className="travel">
                <h3> Travel</h3>
                <div className="travelbottom">
                    <h4>Step 1: Getting over</h4>

                    <p>Check if you need to get a visa or an electronic travel authorization </p>
                    <a href="https://www.canada.ca/en/immigration-refugees-citizenship/services/visit-canada/eta/apply.html" target="_blank" rel="noreferrer" >https://www.canada.ca/en/immigration-refugees-citizenship/services/visit-canada/eta/apply.html</a>

                    <h4>Step 2: Flights!</h4>

                    <p>The closest city to the wedding venue is Ottawa, Ontario (where Elyse grew up). If you want to explore a bit or want more flight options, you could also fly into Toronto, Ontario (a 4.5 hour drive to Ottawa) or Montreal, Quebec (a 2 hour drive to Ottawa).</p>

                    <h4>Step 3: Accommodation</h4>

                    <p>We will be organizing shuttles to and from the wedding venue on the day of the wedding for those staying in Wakefield as well as Downtown Ottawa. Wakefield is approximately 30 minutes drive from Ottawa and is a small beautiful village in the province of Quebec.  There are a few hotels and b&bs in the area but not as many options as Ottawa. Ottawa is Canada’s capital city and there is more choice for accommodation.</p>

                    <h4>Ottawa</h4>

                    <a href="https://ottawatourism.ca/en/about-ottawa" target="_blank" rel="noreferrer" >https://ottawatourism.ca/en/about-ottawa</a>

                    <h4>Wakefield</h4>

                    <a href="http://www.destinationwakefield.com/getting-here/" target="_blank" rel="noreferrer" >http://www.destinationwakefield.com/getting-here/</a>

                    <p>If you want a truly Canadian experience, you could rent a cottage on a lake nearby as the wedding venue is in a beautiful location for those of you who enjoy the outdoors.</p>

                    <i>Canada will be HOT in August so please protect your skin - yes I’m looking at you, Ireland.</i>
                </div>
            </div >
        )
    }
}

export default Travel;
